import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Message from './components/Message'
import Login from './components/Login'
import Tracking from './components/Tracking'
import Subscribe from './components/Subscribe'
import reportWebVitals from './reportWebVitals';

ReactDOM.render(<App />, document.getElementById('root'));
ReactDOM.render(<Message />, document.getElementById('rootMessage'));
ReactDOM.render(<Login />, document.getElementById('rootLogin'));
ReactDOM.render(<Subscribe />, document.getElementById('rootSubscribe'));
ReactDOM.render(<Tracking />, document.getElementById('rootTracking'));

reportWebVitals();
